import React, { Component } from 'react';
import Footer from '../../components/Footer';
import Card from '../../components/Card';
import Space from '../../components/Space';
import ProfileCard from '../../components/ProfileCard';
import CardGroup from '../../components/CardGroup';
import imgProfileDefault from '../../assets/profileDefault.png';
import axios from 'axios';

import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';


class PerfilUsuario extends Component {
    constructor(props){
        super(props);

        this.state = {
            posts: {},
            userData: {
                nomeCompleto: localStorage.getItem('nomeCompleto'),
                telefone: localStorage.getItem('telefone'),
                email: localStorage.getItem('email'),
                idUsuario: localStorage.getItem('idUsuario'),
                descricao: localStorage.getItem('descricao'),
                localidade: localStorage.getItem('localidade'),
                imagemPerfil: localStorage.getItem('imagemPerfil'),
                categoria: localStorage.getItem('categoria')
            },
            test: [
                <img src="https://www.mickgeorge.co.uk/media/catalog/product/cache/5dc500509c6ad7bb407691a3a9e031b4/w/o/wooden_gravel_board_1_1-1_3_1.jpg" />,
                <img src="https://media.karousell.com/media/photos/products/2020/10/31/wooden_rack_1604117402_29c945c7.jpg"  />,
                <img src="https://homebarnshop.co.uk/wp-content/uploads/2017/10/Rustic-Antique-Wooden-Stool.jpg" />,
                ]           
        }

    }

    componentDidMount = () => {
        const url = 'http://localhost:3001/' + localStorage.getItem('idUsuario') + '/publicacoes'
        console.log(url)
        axios.get(url,{
            headers:{
                'authorization': localStorage.getItem('token')
            }
        })
            .then(response => {

                let imagem = {};                
                for( var i in response.data){
                    let idPublicacao = response.data[i].idPublicacao;
                    let nomeImagem = response.data[i].nomeImagem;
                    imagem[i] = {idPublicacao,nomeImagem};
                }
                this.setState({
                    // posts: imagem,
                    posts: {
                        0: "data:image/jpeg;base64,",
                        1: "data:image/jpeg;base64,"
                    }
                })
            })
            .catch(error => {
                console.log(error);
                this.setState({
                    // posts: imagem,
                    posts: {
                        0: "data:image/jpeg;base64,",
                        1: "data:image/jpeg;base64,"
                    }
                })
            })
    }

    render() {
        return (
            <>
                <main>
                    <Space/>
                    <h2>{localStorage.getItem("name")}</h2>
                    <ProfileCard
                        src={imgProfileDefault}
                        title="Descrição:"
                        description={localStorage.getItem("descricao") || "Sem descrição"}
                    />
                    <Space size="10px"/>
                    <CardGroup>
                        <Card>
                            <p><strong>Categoria:</strong><br/>
                            {localStorage.getItem("categoria") || "Não definido"}</p>
                        </Card>
                        <Card>
                            <p><strong>Telefone:</strong><br/>
                            {localStorage.getItem("telefone") || "Não definido"}</p>
                        </Card>
                        <Card>
                            <p><strong>Região:</strong><br/>
                            {localStorage.getItem("localidade") || "Não definido"}</p>
                        </Card>
                    </CardGroup>
                    <div id="carrossel">
                        <h1>Publicações</h1>
                        <AliceCarousel mouseTracking items={this.state.test} />
                    </div>
                </main>
                <Footer/>
            </>
        )
    }
}

export default PerfilUsuario;
